    /// <summary>
    /// This namespace parses JSON strings according to RFC-8259: https://www.rfc-editor.org/rfc/rfc8259
    /// </summary>

    /// <summary>
    /// This class defines array of parsed JSON properties arranged as ordered path members.
    /// </summary>
    public class JsonPath
    {
        // Constructor that takes no arguments.
        public JsonPath()
        {
            Depth = -1;
            Members = new List<JsonTokenEnriched>();
            Content = null;
            ContentDecoded = null;
        }

        // Constructor that takes one argument.
        public JsonPath(JsonPath jsonPath)
        {
            Depth = jsonPath.Depth;
            Members = jsonPath.Members;
            Content = jsonPath.Content;
            ContentDecoded = jsonPath.ContentDecoded;
        }

        // Constructor that takes one argument.
        public JsonPath(List<JsonTokenEnriched> tokens)
        {
            Depth = tokens[tokens.Count - 1].Depth;
            Members = tokens;
            Content = string.Join('.', tokens.Select(token => JsonParser.TrimOne(((JsonTokenEnriched)token).Content, '"')));
            ContentDecoded = string.Join('.', tokens.Select(token => JsonParser.TrimOne(((JsonTokenEnriched)token).ContentDecoded, '"')));
        }

        // Auto-implemented readonly properties.
        public int Depth { get; set; }
        public List<JsonTokenEnriched> Members { get; set; }
        public string Content { get; set; }
        public string ContentDecoded { get; set; }

        // Method that pushes input JsonTokenEnriched onto JsonPath object and updates corresponding properties.
        public void Push(JsonTokenEnriched jsonToken)
        {
            // Add input JsonTokenEnriched to current JsonPath Members property.
            Members.Add(jsonToken);

            // Create temporary JsonPath object to generate updated property values.
            JsonPath updatedJsonPath = new JsonPath(Members);

            // Update current JsonPath properties with property values from newly generated JsonPath object above.
            Depth = updatedJsonPath.Depth;
            Members = updatedJsonPath.Members;
            Content = updatedJsonPath.Content;
            ContentDecoded = updatedJsonPath.ContentDecoded;
        }

        // Method that pops latest JsonTokenEnriched from JsonPath object and updates corresponding properties.
        public void Pop()
        {
            // Remove latest JsonTokenEnriched from current JsonPath Members property.
            Members.RemoveAt(Members.Count - 1);

            // Create temporary JsonPath object to generate updated property values.
            JsonPath updatedJsonPath = Members.Count == 0 ? new JsonPath() : new JsonPath(Members);

            // Update current JsonPath properties with property values from newly generated JsonPath object above.
            Depth = updatedJsonPath.Depth;
            Members = updatedJsonPath.Members;
            Content = updatedJsonPath.Content;
            ContentDecoded = updatedJsonPath.ContentDecoded;
        }

        // Method that overrides the base class (System.Object) implementation.
        public override string ToString()
        {
            //return Content;
            return $"Depth: {Depth}, Content: {Content}, ContentDecoded: {ContentDecoded}, Members: {Members}";
        }
    }

