    /// <summary>
    /// This class defines token object for deeply enriched tokenized JSON.
    /// </summary>
    public class JsonTokenEnriched : JsonToken
    {
        // Constructor that takes no arguments.
        public JsonTokenEnriched()
        {
            Content = null;
            ContentDecoded = null;
            Type = JsonTokenType.Undefined;
            TypeBefore = JsonTokenType.Undefined;
            TypeAfter = JsonTokenType.Undefined;
            SubType = null;
            Format = null;
            Start = -1;
            Length = -1;
            Depth = -1;
            Context = new JsonContext();
            Path = new JsonPath();
            TokenList = new List<JsonTokenEnriched>();
        }

        // Constructor that takes JsonToken as an argument to copy over corresponding properties into new JsonTokenEnriched object.
		public JsonTokenEnriched(JsonToken jsonToken)
        {
			// Define string for potential decoded version of Content property, initialized to Content property if not eligible for decoding.
			string jsonTokenContentDecoded = jsonToken.Content;

			// Retrieve JsonContext object for input JsonToken based on its Type.
			JsonContext jsonTokenContext = JsonParser.GetTokenContext(jsonToken);

			// If JsonContext object was retrieved above then extract decoded value for final ContentDecoded property.
			if (jsonTokenContext != null)
			{
				switch (jsonToken.Type)
				{
					case JsonTokenType.Name:
						jsonTokenContentDecoded = jsonTokenContext.Name.ContentDecoded;
						break;
					case JsonTokenType.Value:
						jsonTokenContentDecoded = jsonTokenContext.Value.ContentDecoded;
						break;
				}
			}

            Content = jsonToken.Content;
			ContentDecoded = jsonTokenContentDecoded;
            ContentParsedList = jsonToken.Format == JsonTokenFormat.String ? JsonParser.ParseJsonString(jsonToken.Content) : new List<JsonStringParsed>();
            Type = jsonToken.Type;
            TypeBefore = null;
            TypeAfter = null;
            SubType = jsonToken.SubType != null ? jsonToken.SubType : null;
			Format = jsonToken.Format;
            Start = jsonToken.Start;
            Length = jsonToken.Length;
            Depth = jsonToken.Depth;
			Context = jsonTokenContext;
            Path = new JsonPath();
            TokenList = jsonToken.TokenList.ConvertAll(token => new JsonTokenEnriched(token));
        }

        // Constructor that takes JsonToken as an argument to copy over corresponding properties into new JsonTokenEnriched object.
        public JsonTokenEnriched(JsonTokenEnriched jsonTokenEnriched)
        {
            Content = jsonTokenEnriched.Content;
            ContentDecoded = jsonTokenEnriched.ContentDecoded;
            ContentParsedList = jsonTokenEnriched.Format == JsonTokenFormat.String ? JsonParser.ParseJsonString(jsonTokenEnriched.Content) : new List<JsonStringParsed>();
            Type = jsonTokenEnriched.Type;
            TypeBefore = jsonTokenEnriched.TypeBefore;
            TypeAfter = jsonTokenEnriched.TypeAfter;
            SubType = jsonTokenEnriched.SubType != null ? jsonTokenEnriched.SubType : null;
			Format = jsonTokenEnriched.Format;
            Start = jsonTokenEnriched.Start;
            Length = jsonTokenEnriched.Length;
            Depth = jsonTokenEnriched.Depth;
			Context = jsonTokenEnriched.Context;
            Path = jsonTokenEnriched.Path;
            TokenList = jsonTokenEnriched.TokenList;
        }

        // Auto-implemented readonly properties.
        public Nullable<JsonTokenType> TypeBefore { get; set; }
        public Nullable<JsonTokenType> TypeAfter { get; set; }
		public JsonContext Context { get; set; }
        public JsonPath Path { get; set; }
        // Override inherited TokenList property to change type from List<JsonToken> to List<JsonTokenEnriched>.
        public new List<JsonTokenEnriched> TokenList { get; set; }
        public string ContentDecoded { get; set; }
        public List<JsonStringParsed> ContentParsedList { get; set; }

        // Method that overrides the base class (System.Object) implementation.
        public override string ToString()
        {
            return $"Depth: {Depth}, Length: {Length}, Format: {Format}, Type: {Type}, SubType: {SubType}, Content: {Content}, ContentDecoded: {ContentDecoded}, Path.ContentDecoded: {Path.ContentDecoded}, Path.Content: {Path.Content}";
        }
    }

