    /// <summary>
    /// This class holds full context of Value token, notably including parsed and decoded Content properties.
    /// </summary>
    public class JsonValueContext
    {
        // Constructor that takes no arguments.
        public JsonValueContext()
        {
			Content = "";
			ContentDecoded = "";
			ContentParsedList = new List<JsonStringParsed>();
        }

        // Constructor that takes one argument.
        public JsonValueContext(List<JsonStringParsed> contentParsedList)
		{
			Content = string.Concat(contentParsedList.Select(parsedChar => parsedChar.Content));
			ContentDecoded = string.Concat(contentParsedList.Select(parsedChar => parsedChar.ContentDecoded));
			ContentParsedList = contentParsedList;
        }

        // Auto-implemented readonly properties.
        public string Content { get; set; }
		public string ContentDecoded { get; set; }
		public List<JsonStringParsed> ContentParsedList { get; set; }

        // Method that overrides the base class (System.Object) implementation.
        public override string ToString()
        {
            return $"Content: {Content}, ContentDecoded: {ContentDecoded}, ContentParsedList: {ContentParsedList}";
        }
    }

