    /// <summary>
    /// This class defines objects for individually-parsed characters from JSON string tokens, notably
    /// including character Format, Class, Case and decoded Content properties.
    /// </summary>
    public class JsonStringParsed
    {
        // Constructor that takes no arguments.
        public JsonStringParsed()
        {
			Content = null;
			ContentDecoded = null;
			IsDecoded = false;
			Format = JsonStringParsedFormat.Undefined;
			Class = CharClass.Undefined;
			Case = CharCase.Undefined;
			IsPrintable = false;
        }

        // Constructor that takes two arguments.
        public JsonStringParsed(string content, string contentDecoded)
		{
			Content = content;
			ContentDecoded = contentDecoded;
			IsDecoded = false;
			Format = content.StartsWith('\\') ? JsonStringParsedFormat.EscapedUnknown : JsonStringParsedFormat.Undefined;
			Class = CharClass.Undefined;
			Case = CharCase.Undefined;
			IsPrintable = false;
        }

		// Constructor that takes six arguments.
        public JsonStringParsed(string content, string contentDecoded, JsonStringParsedFormat format, CharClass charClass, CharCase charCase, bool isPrintable)
		{
			Content = content;
			ContentDecoded = contentDecoded;
			IsDecoded = (format == JsonStringParsedFormat.Hex) ? true : false;
			Format = format;
			Class = charClass;
			Case = charCase;
			IsPrintable = isPrintable;
        }

        // Auto-implemented readonly properties.
        public string Content { get; set; }
		public string ContentDecoded { get; set; }
        public bool IsDecoded { get; set; }
        public JsonStringParsedFormat Format { get; set; }
        public CharClass Class { get; set; }
        public CharCase Case { get; set; }
        public bool IsPrintable { get; set; }

        // Method that overrides the base class (System.Object) implementation.
        public override string ToString()
        {
            return $"Content: {Content}, ContentDecoded: {ContentDecoded}, IsDecoded: {IsDecoded}, Format: {Format}, Class: {Class}, Case: {Case}, IsPrintable: {IsPrintable}";
        }
    }

