    /// <summary>
    /// This class defines object storing all enriched tokens comprising a JSON branch (which is
    /// a nested parse tree/syntax tree structure containing entire JSON document).
    /// </summary>
    public class JsonBranch
    {
        // Constructor that takes no arguments.
        public JsonBranch()
        {
            Path = new JsonPath();
			Content = null;
			ContentDecoded = null;
            Type = JsonBranchType.Object;
            Branch = new List<object>();
            Index = -1;
            Start = -1;
            Length = -1;
            Depth = -1;
            DepthMax = -1;
        }

        // Constructor that takes four arguments.
		public JsonBranch(JsonBranchType type, JsonPath path, int index, int depth)
        {
            Path = path;
			Content = null;
			ContentDecoded = null;
            Type = type;
            Branch = new List<object>();
            Index = index;
            Start = -1;
            Length = -1;
            Depth = depth;
            DepthMax = depth;
        }

        // Auto-implemented readonly properties.
        public int Start { get; set; }
        public int Length { get; set; }
        public int Index { get; set; }
        public JsonPath Path { get; set; }
        public string Content { get; set; }
        public string ContentDecoded { get; set; }
        public int Depth { get; set; }
        public int DepthMax { get; set; }
        public JsonBranchType Type { get; set; }
        public List<object> Branch { get; set; }

        // Method that overrides the base class (System.Object) implementation.
        public override string ToString()
        {
            return $"Start: {Start}, Length: {Length}, Depth: {Depth}, DepthMax: {DepthMax}, Path.Content: {Path.Content}, Path.ContentDecoded: {Path.ContentDecoded}, Content: {Content}, ContentDecoded: {ContentDecoded}, Index: {Index}, Type: {Type}";
        }
    }

    /// <summary>
    /// This class defines per-rule Detection information generated for suspicious JSON documents.
    /// </summary>
    public class Detection
    {
        // Constructor that takes seven arguments for JsonToken input.
        public Detection(JsonTokenEnriched jsonToken, string author, DateTime date, DetectionID id, string name, string example, double score)
        {
			// Detection input type.
			Type = JsonBranchType.Member;
			//
			// Detection rule metadata.
			Author = author;
			Date = date;
			ID = id;
			Name = name;
			Example = example;
			Score = score;
			//
			// Detection hit context.
			Depth = jsonToken.Depth;
			Start = jsonToken.Start;
			Content = jsonToken.Content;
			ContentDecoded = jsonToken.ContentDecoded;
        }

        // Constructor that takes seven arguments for JsonBranch input.
        public Detection(JsonBranch jsonBranch, string author, DateTime date, DetectionID id, string name, string example, double score)
        {
			// Detection input type.
			Type = jsonBranch.Type;
			//
			// Detection rule metadata.
			Author = author;
			Date = date;
			ID = id;
			Name = name;
			Example = example;
			Score = score;
			//
			// Detection hit context.
			Depth = jsonBranch.Depth;
			Start = jsonBranch.Start;
			Content = jsonBranch.Content;
			ContentDecoded = jsonBranch.ContentDecoded;
        }

        // Auto-implemented readonly properties.
		//
		// Detection input type.
        public JsonBranchType Type { get; set; }
		//
		// Detection rule metadata.
        public string Author { get; set; }
        public DateTime Date { get; set; }
        public DetectionID ID { get; set; }
        public string Name { get; set; }
        public string Example { get; set; }
        public double Score { get; set; }
		//
		// Detection hit context.
        public int Depth { get; set; }
        public int Start { get; set; }
        public string Content { get; set; }
        public string ContentDecoded { get; set; }

        // Method that overrides the base class (System.Object) implementation.
        public override string ToString()
        {
			return $"Score={Score}, ID={ID}, Name={Name}, Depth={Depth}, Start={Start}, Content={Content}, ContentDecoded={ContentDecoded}";
        }
    }

    /// <summary>
    /// This class defines Detection information summarized for all matching Detection rule(s) generated for suspicious JSON documents.
    /// </summary>
