        /// <summary>
        /// This method returns fully parsed input JSON string (including escaped and hex encoded characters).
        /// </summary>
        public static List<JsonStringParsed> ParseJsonString(string jsonString)
        {
			// Return empty JsonStringParsed List if null or empty.
            if (jsonString.Length == 0)
            {
                return new List<JsonStringParsed>();
            }

            // Create List to store ParseJsonString objects parsed from input jsonString string.
            List<JsonStringParsed> parsedValueResults = new List<JsonStringParsed>();

			// Parse each character in input jsonString string.
			for (int i = 0; i < jsonString.Length; i++)
            {
				// Extract next character in remaining jsonString string.
				char nextChar = jsonString[i];

				// Initialize current character as a string for default Content and ContentDecoded property values in final JsonStringParsed result.
				// String format required for potential 2-character (e.g. '\n') and 6-character (e.g. '\u0061') Content values for escaped and hex-encoded parsing scenarios.
				string content = nextChar.ToString();
				string contentDecoded = content;

				// If nextChar does not exist as key in character Dictionary then add mostly empty JsonStringParsed
				// object to parsedValueResults List and continue to next character in for loop.
				if (!charContextDict.ContainsKey(nextChar))
				{
					// Add mostly empty parsed object to result List.
					parsedValueResults.Add(new JsonStringParsed(content, contentDecoded));

					// Continue to next for loop iteration.
					continue;
				}

				// Retrieve nextChar's corresponding object from character Dictionary for additional properties.
				CharContext nextCharObj = charContextDict[nextChar];

				// Transpose properties from nextChar's character object to additional variables to be used in JsonStringParsed constructor at end of function.
				CharClass contentDecodedClass = nextCharObj.Class;
				CharCase contentDecodedCase = nextCharObj.Case;
				bool isPrintable = nextCharObj.IsPrintable;

				// Set nextChar's contentDecodedFormat to Default unless overridden later in current function.
				JsonStringParsedFormat contentDecodedFormat = JsonStringParsedFormat.Default;

				// Potentially override above Default values if next char is an EscapedKnown or Hex encoded scenario.
				if (nextChar == '\\')
				{
					// Backslash character ('\') is an EscapedUnknown by default with potential upgrade to EscapedKnown or Hex Format.
					contentDecodedFormat = JsonStringParsedFormat.EscapedUnknown;

					// Break if nextChar is last character in remaining jsonString string.
					if ((i + 1) == jsonString.Length)
					{
						break;
					}

					// Extract single character immediately following nextChar character.
					char nextChar2 = jsonString[i + 1];

                    // Check if escaped nextChar2 character has escapable meaning in JSON.
                    if (jsonEscapableCharDict.ContainsKey(nextChar2))
					{
                        // Upgrade current escaped character from EscapedUnknown to EscapedKnown.
                        contentDecodedFormat = JsonStringParsedFormat.EscapedKnown;

						// Update default Content and ContentDecoded property values with concatenation of first two characters for EscapedKnown format
						// and increment for loop's iterator by one to avoid double-parsing this look-ahead character.
						content = nextChar.ToString() + nextChar2.ToString();
                        contentDecoded = jsonEscapableCharDict[nextChar2].ToString();
						i++;
					}
					else if (nextChar2 == 'u' && jsonStringLeadingUnicodeEncoding.Match(jsonString.Substring(i)).Success)
					{
						// Next token is unicode encoding syntax (e.g. \u0065), so extract entire value as single token.

                        // Upgrade current hex-encoded unicode character from EscapedUnknown to Hex.
						contentDecodedFormat = JsonStringParsedFormat.Hex;

						// Since confirmed hex encoding scenario (e.g. '\u0061') then update content string with next five characters,
						// set contentDecoded to the hex-to-char conversion and increment for loop's iterator by five to avoid
						// double-parsing these look-ahead hex encoding characters.
						content = jsonString.Substring(i,6);
						contentDecoded = Char.ConvertFromUtf32(Convert.ToInt32(content.Substring(2,4), 16)).ToString();
						i += 5;
					}
					else
					{
                        // If nextChar2 is not a known escapable character or beginning of hex encoding scenario then add mostly empty JsonStringParsed
                        // object to parsedValueResults List and continue to next character in for loop.

						// Update default Content and ContentDecoded property values with concatenation of first two characters for EscapedUnknown format
						// and increment for loop's iterator by one to avoid double-parsing this look-ahead character.
						content = nextChar.ToString() + nextChar2.ToString();
						contentDecoded = content;
						i++;

						// Add mostly empty parsed object to result List.
						parsedValueResults.Add(new JsonStringParsed(content, contentDecoded));

						// Continue to next for loop iteration.
						continue;
					}

					// If decoded value for escaped character does not exist as key in character Dictionary then update additional properties with mainly Undefined values.
					// Otherwise retrieve decoded character's correponding object from character Dictionary for additional properties.
					if (!charContextDict.ContainsKey(Char.Parse(contentDecoded)))
					{
						// Update additional properties for current decoded character.
						isPrintable = false;
						contentDecodedClass = CharClass.Undefined;
						contentDecodedCase = CharCase.Undefined;
					}
					else
					{
						// Retrieve decoded character's corresponding object from character Dictionary for additional properties.
						CharContext contentDecodedCharObj = charContextDict[Char.Parse(contentDecoded)];

						// Update additional properties for current hex-decoded character.
						isPrintable = contentDecodedCharObj.IsPrintable;
						contentDecodedClass = contentDecodedCharObj.Class;
						contentDecodedCase = contentDecodedCharObj.Case;
					}
				}

                // If current character is leading/trailing unescaped quote character then update format property. 
                if (nextChar == jsonTokenFormatLeadingChar[JsonTokenFormat.String][0] && (i == 0 || i == jsonString.Length - 1))
                {
                    // Upgrade current leading/trailing unescaped quote character from Default to Protected.
                    contentDecodedFormat = JsonStringParsedFormat.Protected;
                }

				// Create and add final JsonStringParsed object to result List.
				parsedValueResults.Add(new JsonStringParsed(content, contentDecoded, contentDecodedFormat, contentDecodedClass, contentDecodedCase, isPrintable));			
			}

			// Return final List of JsonStringParsed objects for input jsonString string.
			return parsedValueResults;
		}

        /// <summary>
        /// This method extracts next JSON string (including required encapsulating double quote characters).
        /// </summary>
        public static string ExtractString(string jsonString)
        {
            // Return null if input JSON string is null or empty.
            if (jsonString.Length == 0)
            {
                return null;
            }

            // Define double quote as only valid quote for JSON definition of string.
            char validQuoteChar = jsonTokenFormatLeadingChar[JsonTokenFormat.String][0];

			// Throw exception if invalid leading string character detected.
			if (jsonString[0] != validQuoteChar)
			{
				throw new System.Exception("[SkyScalpel.JsonParser]::ExtractString - Invalid leading string character (" + jsonString[0] + ") detected.");
			}

			// Remove any potential escaped quote characters to simplify identifying encapsulating quotation characters for current string.
            string jsonStringEscapesRemoved = jsonString.Replace(@"\\", "__").Replace($@"\{validQuoteChar}", "__");

			// Calculate length (without encapsulating quotation characters) of current string.
			int innerStringLength = TrimStartOne(jsonStringEscapesRemoved,validQuoteChar).IndexOf(validQuoteChar);

			// Extract string (including encapsulating quotation characters).
			string extractedString = jsonString.Substring(0, innerStringLength + 2);

			// Return extracted string.
            return extractedString;
        }

        /// <summary>
        /// This method returns list of JSON tokens parsed from an entire JSON document.
        /// </summary>
        public static List<JsonToken> Tokenize(string jsonString)
        {
            // Throw exception if input JSON string is null or empty.
            if (jsonString.Length == 0)
            {
				throw new System.Exception($"[SkyScalpel.JsonParser]::Tokenize - Input JSON string is null or empty.");
            }

            // Create List to store JsonTokens parsed from input JSON string.
            List<JsonToken> tokenResults = new List<JsonToken>();

            // Track input string index and ongoing depth (for indentation purposes) throughout parsing.
            int jsonStringIndex = 0;
            int jsonStringDepth = 0;

            // Track last jsonString value to break if no parsing occurs in any given while loop iteration.
            string lastJsonString = null;

			// Track latest parsed token's Type if it is not insignificant Whitespace.
			// This will be used to more efficiently differentiate Member Object's Name and Value tokens.
			JsonTokenType lastSignificantTokenType = JsonTokenType.Undefined;

			// Create and initialize Stack to track ongoing history of structured type (Object or Array) characters
			// for contextual awareness when parsing Array elements.
			Stack structuredTypeCharStack = new Stack();

            // Continue parsing until no more input jsonString remains (or until an iteration yields no
			// parsed change to avoid an infinite loop).
            while ((jsonString.Length > 0) && (jsonString != lastJsonString))
            {
                lastJsonString = jsonString;

                // Extract next character (as both char and string) in remaining JSON string.
                char nextChar = jsonString[0];
                string nextTokenContent = nextChar.ToString();

				// Parse next token based on extracted next character.
                switch (nextChar)
                {
                    case char curChar when jsonTokenTypeLeadingChar[JsonTokenType.BeginObject].Contains(curChar):
					{
						// Add extracted token to result List.
						tokenResults.Add(new JsonToken(nextTokenContent, JsonTokenType.BeginObject, jsonStringIndex, jsonStringDepth));

						// Increment current depth since BeginObject token.
						jsonStringDepth++;

						// Push current structured type (Object or Array) character onto Stack.
						structuredTypeCharStack.Push(curChar);

						break;
					}
                    case char curChar when jsonTokenTypeLeadingChar[JsonTokenType.EndObject].Contains(curChar):
					{
						// Decrement current depth since EndObject token.
						jsonStringDepth--;

						// Add extracted token to result List.
						tokenResults.Add(new JsonToken(nextTokenContent, JsonTokenType.EndObject, jsonStringIndex, jsonStringDepth));

						// Pop last structured type (Object or Array) character from Stack if it is closed by current character.
						if (jsonTokenTypeLeadingChar[JsonTokenType.BeginObject].Contains(Convert.ToChar(structuredTypeCharStack.Peek())))
						{
							structuredTypeCharStack.Pop();
						}

						break;
					}
                    case char curChar when jsonTokenTypeLeadingChar[JsonTokenType.BeginArray].Contains(curChar):
					{
						// Add extracted token to result List.
						tokenResults.Add(new JsonToken(nextTokenContent, JsonTokenType.BeginArray, jsonStringIndex, jsonStringDepth));

						// Increment current depth since BeginArray token.
						jsonStringDepth++;

						// Push current structured type (Object or Array) character onto Stack.
						structuredTypeCharStack.Push(curChar);

						break;
					}
                    case char curChar when jsonTokenTypeLeadingChar[JsonTokenType.EndArray].Contains(curChar):
					{
						// Decrement current depth since EndArray token.
						jsonStringDepth--;

						// Add extracted token to result List.
						tokenResults.Add(new JsonToken(nextTokenContent, JsonTokenType.EndArray, jsonStringIndex, jsonStringDepth));

						// Pop last structured type (Object or Array) character from Stack if it is closed by current character.
						if (jsonTokenTypeLeadingChar[JsonTokenType.BeginArray].Contains(Convert.ToChar(structuredTypeCharStack.Peek())))
						{
							structuredTypeCharStack.Pop();
						}

						break;
					}
					case char curChar when jsonTokenFormatLeadingChar[JsonTokenFormat.String].Contains(curChar):
					{
						// Next token is string, so extract entire string as single token and determine if Name or Value based on context.
						nextTokenContent = ExtractString(jsonString);

						// Define JsonTokenFormat for extracted token.
						JsonTokenFormat nextTokenFormat = JsonTokenFormat.String;

						// Define current structured type context based on last opening structured type character on Stack.
						JsonTokenSubType nextTokenSubType = jsonTokenTypeLeadingChar[JsonTokenType.BeginArray].Contains(Convert.ToChar(structuredTypeCharStack.Peek())) ? JsonTokenSubType.ArrayElement : JsonTokenSubType.ObjectMember;

						// Define JsonTokenType for extracted token based on current structured type context (Array Element or Object Member)
						// and (for Object Member) last significant token's TokenType.
						JsonTokenType nextTokenType = JsonTokenType.Undefined;
						switch (nextTokenSubType)
						{
							case JsonTokenSubType.ArrayElement:
							{
								nextTokenType = JsonTokenType.Value;
								break;
							}
							case JsonTokenSubType.ObjectMember:
							{
								nextTokenType = lastSignificantTokenType == JsonTokenType.NameSeparator ? JsonTokenType.Value : JsonTokenType.Name;
								break;
							}
						}

						// Add extracted token to result List.
						tokenResults.Add(new JsonToken(nextTokenContent, nextTokenType, nextTokenSubType, nextTokenFormat, jsonStringIndex, jsonStringDepth));

						break;
					}
					case char curChar when jsonTokenTypeLeadingChar[JsonTokenType.Value].Contains(curChar):
					{
						// Next token is non-string Value, so extract entire value as single token.
						Match valueMatch = jsonTokenTypeValueNonString.Match(jsonString);
						if (valueMatch.Success)
						{
							// Define token content from regex match above.
							nextTokenContent = valueMatch.ToString();

							// Define JsonTokenType for extracted token.
							JsonTokenType nextTokenType = JsonTokenType.Value;

							// Define current structured type context based on last opening structured type character on Stack.
							JsonTokenSubType nextTokenSubType = jsonTokenTypeLeadingChar[JsonTokenType.BeginArray].Contains(Convert.ToChar(structuredTypeCharStack.Peek())) ? JsonTokenSubType.ArrayElement : JsonTokenSubType.ObjectMember;

							// Define JsonTokenFormat for extracted token.
							JsonTokenFormat nextTokenFormat = JsonTokenFormat.Undefined;
							switch (nextTokenContent)
							{
								case "true":
									nextTokenFormat = JsonTokenFormat.Boolean;
									break;
								case "false":
									nextTokenFormat = JsonTokenFormat.Boolean;
									break;
								case "null":
									nextTokenFormat = JsonTokenFormat.Null;
									break;
								default:
									nextTokenFormat = JsonTokenFormat.Number;
									break;
							}

							// Add extracted token to result List.
							tokenResults.Add(new JsonToken(nextTokenContent, nextTokenType, nextTokenSubType, nextTokenFormat, jsonStringIndex, jsonStringDepth));
						}
						else
						{
							// Throw exception if non-string Value not successfully extracted above.
							throw new System.Exception($"[SkyScalpel.JsonParser]::Tokenize - Non-string Value not successfully extracted from remaining input JSON string: {jsonString}");
						}

						break;
					}
					case char curChar when jsonTokenTypeLeadingChar[JsonTokenType.NameSeparator].Contains(curChar):
					{
						// Add extracted token to result List.
						tokenResults.Add(new JsonToken(nextTokenContent, JsonTokenType.NameSeparator, jsonStringIndex, jsonStringDepth));

						break;
					}
                    case char curChar when jsonTokenTypeLeadingChar[JsonTokenType.ValueSeparator].Contains(curChar):
					{
						// Add extracted token to result List.
						tokenResults.Add(new JsonToken(nextTokenContent, JsonTokenType.ValueSeparator, jsonStringIndex, jsonStringDepth));

						break;
					}
                    case char curChar when jsonTokenTypeLeadingChar[JsonTokenType.Whitespace].Contains(curChar):
					{
						// Next token is whitespace, so extract all leading whitespace as single token.
						// Perform non-Regex leading whitespace extraction technique via .Substring for performance purposes.
						nextTokenContent = jsonString.Substring(0, (jsonString.Length - jsonString.TrimStart(jsonTokenTypeLeadingChar[JsonTokenType.Whitespace]).Length));

						// Add extracted token to result List.
						tokenResults.Add(new JsonToken(nextTokenContent, JsonTokenType.Whitespace, jsonStringIndex, jsonStringDepth));

						break;
					}
					default :
					{
						// Throw exception if current character is not handled in any parsing scenario above.
						throw new System.Exception("[SkyScalpel.JsonParser]::Tokenize - Unhandled extracted leading character (" + nextChar + ") detected.");
					}
                }

				// Perform final steps for current while loop iteration if token successfully extracted above.
				if (nextTokenContent.Length > 0)
				{
					// Calculate length of extracted token.
					int extractedTokenLength = nextTokenContent.Length;

					// Remove extracted token from remaining JSON string and increase current index.
					jsonString = jsonString.Substring(extractedTokenLength);
					jsonStringIndex += extractedTokenLength;

					// Update last token Type if it is not insignificant Whitespace.
					if (tokenResults.Last().Type != JsonTokenType.Whitespace)
					{
						lastSignificantTokenType = tokenResults.Last().Type;
					}
				}
				else
				{
					// Throw exception if token not successfully extracted above.
					throw new System.Exception($"[SkyScalpel.JsonParser]::Tokenize - Token not successfully extracted from remaining input JSON string: {jsonString}");
				}
            }

			// Throw exception if last while loop iteration did not perform any parsing of jsonString.
			if (jsonString == lastJsonString)
			{
				throw new System.Exception($"[SkyScalpel.JsonParser]::Tokenize - Unhandled parsing scenario for remaining input JSON string: {jsonString}");
			}

            // Return List of parsed JsonTokens.
            return tokenResults;
        }

        /// <summary>
        /// This method returns list of enriched JSON tokens based on input list of JSON tokens parsed from an entire JSON document.
        /// </summary>
        public static List<JsonTokenEnriched> ToTokenEnriched(List<JsonToken> jsonTokens)
        {
            // Return input List as-is if it is null or empty.
            if (jsonTokens.Count == 0)
            {
                return new List<JsonTokenEnriched>();
            }

            // Convert input List from List<JsonToken> to List<JsonTokenEnriched>.
            List<JsonTokenEnriched> jsonTokensEnriched = jsonTokens.ConvertAll(token => new JsonTokenEnriched(token));

            // Create JsonPath object to track and add current JSON path to each enriched JSON token's Path property.
            JsonPath curJsonPath = new JsonPath();

            // Iterate over all enriched JSON tokens.
            for (int i = 0; i < jsonTokensEnriched.Count; i++)
            {
                JsonTokenEnriched token = jsonTokensEnriched[i];

                // If current JsonToken is the beginning of a new JsonPath segment then push onto JsonPath object.
                if (token.Type == JsonTokenType.Name)
                {
                    // Push current JsonToken onto JsonPath object.
                    curJsonPath.Push(token);
                }

                // If current JsonToken is a potential path-delimiting type then pop from current
                // JsonPath object any JsonTokens with depth greater than current JsonToken.
                if (
                    token.Type == JsonTokenType.EndObject ||
                    token.Type == JsonTokenType.ValueSeparator
                )
                {
                    // Calculate new target JsonPath depth based on current JsonToken type.
                    int targetJsonPathDepth = token.Type == JsonTokenType.EndObject ? token.Depth + 1 : token.Depth;

                    // Pop from JsonPath object any JsonTokens exceeding new target JsonPath depth.
                    while (curJsonPath.Members.Count > 0 && targetJsonPathDepth <= curJsonPath.Members[curJsonPath.Members.Count - 1].Depth)
                    {
                        curJsonPath.Pop();
                    }

                    // Copy updated JsonPath object onto previous JsonToken's Path property if
                    // previous JsonToken is a Whitespace type.
                    if (i - 1 >= 0 && jsonTokensEnriched[i - 1].Type == JsonTokenType.Whitespace)
                    {
                        // Set previous JsonToken's Path property with copy of current JsonPath.
                        jsonTokensEnriched[i - 1].Path = new JsonPath(curJsonPath);
                    }
                }

                // Set current JsonToken's Path property with copy of current JsonPath.
                token.Path = new JsonPath(curJsonPath);

                // Set TypeBefore and TypeAfter property values based on current token's neighboring token Type property value(s).
                // Handle bookend token scenarios separately.
                if (i == 0 || i == (jsonTokensEnriched.Count - 1))
                {
                    // Handle first and potential last tokens separately so remaining for loop can more efficiently
                    // process TypeBefore/TypeAfter assignment without needing to check for bookend scenarios each iteration.
                    if (jsonTokensEnriched.Count > 1)
                    {
                        // If more than one token is present then handle bookend scenarios.

                        // For first token assign TypeBefore to null and TypeAfter to the next token's Type property value.
                        jsonTokensEnriched[0].TypeBefore = null;
                        jsonTokensEnriched[0].TypeAfter = jsonTokensEnriched[1].Type;

                        // For last token assign TypeAfter to null and TypeBefore to the previous token's Type property value.
                        jsonTokensEnriched[jsonTokensEnriched.Count - 1].TypeBefore = jsonTokensEnriched[jsonTokensEnriched.Count - 2].Type;
                        jsonTokensEnriched[jsonTokensEnriched.Count - 1].TypeAfter = null;
                    }
                    else if (jsonTokensEnriched.Count == 1)
                    {
                        // If only one token is present then assign TypeBefore and TypeAfter properties to null.
                        jsonTokensEnriched[0].TypeBefore = null;
                        jsonTokensEnriched[0].TypeAfter = null;
                    }
                }
                else
                {
                    token.TypeBefore = jsonTokens[i - 1].Type;
                    token.TypeAfter = jsonTokens[i + 1].Type;
                }
            }

            // Return List of feature-enriched JsonTokens.
            return jsonTokensEnriched;
        }

        // Overloaded method to handle multiple input formats.
        public static List<JsonTokenEnriched> ToTokenEnriched(string jsonString)
        {
            // Return List of feature-enriched JsonTokens.
            return JsonParser.ToTokenEnriched(
                    JsonParser.Tokenize(jsonString)
                );
        }

        /// <summary>
        /// This method returns list of input enriched JSON tokens stored as JSON branches in a
        /// nested parse tree/syntax tree structure containing entire JSON document.
        /// </summary>
        public static JsonBranch ToBranch(List<JsonTokenEnriched> jsonTokens, JsonPath jsonPath, JsonBranchType type = JsonBranchType.Object, int depth = 0, int index = 0)
        {
            // Return empty JsonBranch if input List of JsonTokenEnriched objects is null or empty.
            if (jsonTokens.Count == 0)
            {
                return new JsonBranch();
            }

			// Create new JsonBranch to store next recursive set of JsonTokenEnriched object(s).
            JsonBranch jsonBranch = new JsonBranch(type, jsonPath, index, depth);

			// Create StringBuilders to store all Content and ContentDecoded property values for
            // all objects added to newly created JsonBranch above.
			StringBuilder sbJsonBranchContent = new StringBuilder(null);
			StringBuilder sbJsonBranchContentDecoded = new StringBuilder();

			// Create int variable to track maximum Depth property value for all objects added
			// to newly created JsonBranch above.
			int jsonBranchDepthMax = -1;

			// Create Stack to store subset of traversed JsonTokenTypes to help differentiate when ValueSeparator (comma)
			// is building an array versus delineating another property.
			Stack<JsonTokenType> jsonTokenTypeStack = new Stack<JsonTokenType>();
			if (index > 0)
			{
				JsonTokenEnriched initiatingJsonToken = jsonTokens[index - 1];

				if (
					initiatingJsonToken.Type == JsonTokenType.BeginObject ||
					initiatingJsonToken.Type == JsonTokenType.BeginArray ||
					initiatingJsonToken.Type == JsonTokenType.Name
				)
				{
					jsonTokenTypeStack.Push(initiatingJsonToken.Type);
				}
			}

			// Iterate over each merged JsonTokenEnriched object beginning with index defined in function's input parameter.
            for (int i = index; i < jsonTokens.Count; i++)
            {
                JsonTokenEnriched curJsonToken = jsonTokens[i];

                if (
                    curJsonToken.Type == JsonTokenType.BeginObject ||
                    curJsonToken.Type == JsonTokenType.BeginArray ||
                    curJsonToken.Type == JsonTokenType.Name
                )
                {
                    // Determine JsonBranch type based on current JsonToken type.
                    JsonBranchType curJsonBranchType;

                    switch (curJsonToken.Type)
                    {
                        case JsonTokenType.Name:
                            curJsonBranchType = JsonBranchType.Member;
                            break;
                        case JsonTokenType.BeginObject:
                            curJsonBranchType = JsonBranchType.Object;
                            break;
                        case JsonTokenType.BeginArray:
                            curJsonBranchType = JsonBranchType.Array;
                            break;
                        default:
                            curJsonBranchType = JsonBranchType.Object;
                            break;
                    }

                    // Since a BeginObject JsonToken begins a new JsonBranch, increment index
                    // for next JsonToken and recursively create new JsonBranch.
                    // Recursive JsonBranch will inherit current JsonToken's Path and Depth
                    // properties as seen in constructor invocation below.
                    int nextTokenIndex = i + 1;
                    JsonBranch recursiveFilterListBranch = ToBranch(jsonTokens, curJsonToken.Path, curJsonBranchType, curJsonToken.Depth, nextTokenIndex);

                    // Prepend current BeginObject JsonToken to above recursive JsonBranch results (EndObject JsonToken is appended in recursive function call).
                    recursiveFilterListBranch.Branch.Insert(0, curJsonToken);

                    // Prepend BeginObject JsonToken value to current recursively-created
                    // JsonBranch's Content and ContentDecoded properties since it is not
                    // present at the time of JsonBranch creation but is manually added
                    // above on the tail end of recursion.
                    recursiveFilterListBranch.Content = curJsonToken.Content + recursiveFilterListBranch.Content;
                    recursiveFilterListBranch.ContentDecoded = curJsonToken.ContentDecoded + recursiveFilterListBranch.ContentDecoded;

                    // Update Length property for newly created recursive JsonBranch since
                    // BeginObject JsonToken is prepended above at the tail end of recursion.
                    recursiveFilterListBranch.Length = recursiveFilterListBranch.Content.Length;

                    // Update Start and Depth properties for newly created recursive JsonBranch
                    // since BeginObject JsonToken is prepended above at the tail end of recursion.
                    recursiveFilterListBranch.Start = curJsonToken.Start;
                    recursiveFilterListBranch.Depth = curJsonToken.Depth;

                    // Add above recursive JsonBranch results to current JsonBranch.
                    jsonBranch.Branch.Add(recursiveFilterListBranch);

                    // Append current recursively-created JsonBranch's Content and ContentDecoded
                    // values to respective StringBuilders.
                    sbJsonBranchContent.Append(recursiveFilterListBranch.Content);
                    sbJsonBranchContentDecoded.Append(recursiveFilterListBranch.ContentDecoded);

                    // Update jsonBranchDepthMax if recursive JsonBranch's DepthMax
                    // property value exceeds current jsonBranchDepthMax value.
                    jsonBranchDepthMax = recursiveFilterListBranch.DepthMax > jsonBranchDepthMax ? recursiveFilterListBranch.DepthMax : jsonBranchDepthMax;

                    // Advance i index to index of last JsonToken in recursive function call
                    // (which should be a BeginObject JsonToken).
                    // This index will be incremented in next for loop iteration.
                    i = recursiveFilterListBranch.Index;
                }
                else if (
                    (
                        jsonTokenTypeStack.Count > 0 &&
                        jsonTokenTypeStack.Peek() == JsonTokenType.Name
                    ) &&
                    (
                        curJsonToken.Type == JsonTokenType.ValueSeparator ||
                        (curJsonToken.Type == JsonTokenType.Whitespace && curJsonToken.TypeAfter == JsonTokenType.ValueSeparator) ||
                        curJsonToken.Type == JsonTokenType.EndObject ||
                        curJsonToken.Type == JsonTokenType.EndArray
                    )
                )
                {
                    // Update JsonBranch's Index property with index of current JsonToken minus 1.
					jsonBranch.Index = i - 1;

                    // Update JsonBranch's Content and ContentDecoded properties with respective StringBuilders' results.
                    // JsonBranch's Length property will be updated by calling recursive function after adding
                    // originating JsonToken to Content and ContentDecoded properties.
                    jsonBranch.Content = sbJsonBranchContent.ToString();
                    jsonBranch.ContentDecoded = sbJsonBranchContentDecoded.ToString();

                    // Update JsonBranch's DepthMax property with maximum Depth value.
                    jsonBranch.DepthMax = jsonBranchDepthMax;

                    // Return current JsonBranch since current EndObject JsonToken has closed the current JsonBranch.
                    return jsonBranch;
                }
                else if (
                    (
                        jsonTokenTypeStack.Count > 0 &&
                        (
                            (curJsonToken.Type == JsonTokenType.EndObject && jsonTokenTypeStack.Peek() == JsonTokenType.BeginObject) ||
                            (curJsonToken.Type == JsonTokenType.EndArray  && jsonTokenTypeStack.Peek() == JsonTokenType.BeginArray)
                        )
                    )
                )
                {
                    // Add current EndObject JsonToken to current JsonBranch.
                    jsonBranch.Branch.Add(curJsonToken);

                    // Append current JsonToken's Content and ContentDecoded values to respective StringBuilders.
                    sbJsonBranchContent.Append(curJsonToken.Content);
                    sbJsonBranchContentDecoded.Append(curJsonToken.ContentDecoded);

                    // Update JsonBranch's Index property with index of current JsonToken.
                    jsonBranch.Index = i;

                    // Update jsonBranchDepthMax if JsonTokenEnriched's Depth property value exceeds
                    // current jsonBranchDepthMax value.
                    jsonBranchDepthMax = curJsonToken.Depth > jsonBranchDepthMax ? curJsonToken.Depth : jsonBranchDepthMax;

                    // Update JsonBranch's Content and ContentDecoded properties with respective StringBuilders' results.
                    // JsonBranch's Length property will be updated by calling recursive function after adding
                    // originating JsonToken to Content and ContentDecoded properties.
                    jsonBranch.Content = sbJsonBranchContent.ToString();
                    jsonBranch.ContentDecoded = sbJsonBranchContentDecoded.ToString();

                    // Update JsonBranch's DepthMax property with maximum Depth value.
                    jsonBranch.DepthMax = jsonBranchDepthMax;

                    // Return current JsonBranch since current EndObject JsonToken has closed the current JsonBranch.
                    return jsonBranch;
                }
                else
                {
                    // Add current non-BeginObject/non-EndObject JsonToken object to current JsonBranch.
                    jsonBranch.Branch.Add(curJsonToken);

                    // Append current JsonToken's Content and ContentDecoded values to respective StringBuilders.
                    // JsonBranch's Length property will be updated by calling recursive function after adding
                    // originating JsonToken to Content and ContentDecoded properties.
                    sbJsonBranchContent.Append(curJsonToken.Content);
                    sbJsonBranchContentDecoded.Append(curJsonToken.ContentDecoded);

                    // Update jsonBranchDepthMax if JsonTokenEnriched's Depth property value exceeds
                    // current jsonBranchDepthMax value.
                    jsonBranchDepthMax = curJsonToken.Depth > jsonBranchDepthMax ? curJsonToken.Depth : jsonBranchDepthMax;
                }
            }

			// The only JsonBranch reaching this point in the function is the base JsonBranch since
            // this is the original, non-recursive function invocation.

			// Update JsonBranch's Content and ContentDecoded properties with respective StringBuilders' results.
			jsonBranch.Content = string.Concat(jsonBranch.Branch.Select(subBranch => subBranch is JsonTokenEnriched ? ((JsonTokenEnriched)subBranch).Content : ((JsonBranch)subBranch).Content));
			jsonBranch.ContentDecoded = string.Concat(jsonBranch.Branch.Select(subBranch => subBranch is JsonTokenEnriched ? ((JsonTokenEnriched)subBranch).ContentDecoded : ((JsonBranch)subBranch).ContentDecoded));

			// Update JsonBranch's DepthMax property with maximum Depth value.
			jsonBranch.DepthMax = jsonBranchDepthMax;

			// Update JsonBranch's Length property with Content property's length.
			jsonBranch.Length = jsonBranch.Content.Length;

			// Update JsonBranch's Start property with Start property of first object in Branch property.
			jsonBranch.Start = jsonBranch.Branch[0] is JsonTokenEnriched ? ((JsonTokenEnriched)jsonBranch.Branch[0]).Start : ((JsonBranch)jsonBranch.Branch[0]).Start;

            // Return current JsonBranch object.
            return jsonBranch;
        }

        // Overloaded method to handle multiple input formats.
        public static JsonBranch ToBranch(List<JsonTokenEnriched> jsonTokens, JsonBranchType type = JsonBranchType.Member, int depth = -1, int index = 0)
        {
            // Define default JsonPath object if not defined in current overloaded method
            // since technically required in final ToBranch method invocation, but cannot
            // make an optional parameter due to the following error:
            // "Default parameter value for 'jsonPath' must be a compile-time constant".
            JsonPath jsonPath = new JsonPath();

            // Return JsonTokenEnriched objects in a tree format.
            return JsonParser.ToBranch(jsonTokens, jsonPath, type, depth, index);
        }

