			// escaped wildcard character parsing as defined in above regular expressions.
			string doubleEscapeDelim = "\\\\";
			string[] simpleRegexSubstrings = simpleRegexStr.Split(new [] { doubleEscapeDelim }, StringSplitOptions.None);

			// Iterate over each split action substring.
			for (int i = 0; i < simpleRegexSubstrings.Length; i++)
			{
				string simpleRegexSubstring = simpleRegexSubstrings[i];

				// Prepend temporary character to enable simplified wildcardRegex and
				// wildcardSingleCharRegex logic.
				simpleRegexSubstring = "_" + simpleRegexSubstring;

				// Perform potential normalizations in current substring for any
				// eligible unicode single-character wildcard character(s) (\u003f or \u003F).
				do
