					}
				} while (unicodeWildcardSingleCharMatch.Success);

				// Perform potential normalizations in current substring for any
				// eligible unicode wildcard character(s) (\u002a or \u002A).
				do
				{
					unicodeWildcardMatch = unicodeWildcardRegex.Match(simpleRegexSubstring);

					if (unicodeWildcardMatch.Success)
					{
						simpleRegexSubstring = simpleRegexSubstring.Replace(unicodeWildcardMatch.Value, unicodeWildcardMatch.Value[0] + "*");
					}
				} while (unicodeWildcardMatch.Success);

				// Perform potential normalizations in current action substring for any
				// eligible single-character wildcard character(s).
				do
				{
					wildcardSingleCharMatch = wildcardSingleCharRegex.Match(simpleRegexSubstring);

					if (wildcardSingleCharMatch.Success)
					{
						simpleRegexSubstring = simpleRegexSubstring.Replace(wildcardSingleCharMatch.Value, wildcardSingleCharMatch.Value[0] + wildcardSingleCharPlaceholder);
					}
				} while (wildcardSingleCharMatch.Success);

				// Perform potential normalizations in current substring for any
				// eligible wildcard character(s).
				do
				{
					wildcardMatch = wildcardRegex.Match(simpleRegexSubstring);

					if (wildcardMatch.Success)
