						// simpleRegexSubstring boolean input parameter.
						string wildcardReplacement = (isGreedyRegex == true) ? ".*?" : ".*";
						simpleRegexSubstring = simpleRegexSubstring.Replace(wildcardMatch.Value,wildcardMatch.Value[0] + wildcardReplacement);
