				// potentially-modified simpleRegexSubstring.
				simpleRegexSubstrings[i] = simpleRegexSubstring;
			}

			// Join split substrings.
			simpleRegexStr = string.Join(doubleEscapeDelim, simpleRegexSubstrings);

			// Return joined substrings.
			return simpleRegexStr;
