        /// <summary>
        /// This method returns AwsAction objects matching input action string value (including if hex-encoding and/or wildcards are present).
		/// </summary>
		public static List<AwsAction> GetAwsAction(string action)
		{
			// Return empty List of AwsAction objects if null or empty.
			if (action.Length == 0)
			{
				return new List<AwsAction>();
			}

            // Trim single pair of encapsulating double quotes from input action name
            // since these quotes are preserved in parsed String format JsonTokens.
            action = action.StartsWith('"') && action.EndsWith('"') ? JsonParser.TrimOne(action, '"') : action;

            // Return AwsAction object(s) from List that match input action name.
            // For performance purposes differentiate between exact input action name
            // and action name containing filter/regular expression pattern matching.
            if (action == "*" || action == "\\u002a" || action == "\\u002A")
            {
                // Return entire list.
                return awsActionList;
            }
			else if (action.Contains("*") || action.Contains("?") || action.Contains("\\u"))
			{
				// Perform modifications to AWS policy-supported basic wildcard filtering
				// by converting to precise and compliant regular expression.
				action = ConvertToValidRegex(action);

				// Ensure bookened regular expressions are present for precise matching.
                action = !action.StartsWith('^') ? '^' + action : action;
                action = !action.EndsWith('$') ? action + '$' : action;

				// Return AwsAction object(s) from List that case-insensitive
				// match input action name.
				try
				{
					Regex actionRegex = new Regex(action, RegexOptions.IgnoreCase);
					return new List<AwsAction>(awsActionList.Where(actionObj => actionRegex.Match(actionObj.Action).Success));
				}
				catch
				{
					// Return empty List of AwsAction objects if above regex is invalid.
					return new List<AwsAction>();
				}
            }
            else
            {
                // Return exact case-insensitive match.
                return new List<AwsAction>(awsActionList.Where(actionObj => string.Equals(actionObj.Action, action, StringComparison.OrdinalIgnoreCase)));
            }
		}

