        /// <summary>
        /// This method orchestrates the invocation of all FindEvil* methods to return complete list
		/// of Detection objects for each Detection "hit" occurring for every input JSON document.
        /// </summary>
        public static List<Detection> FindEvil(List<JsonTokenEnriched> jsonTokens, List<DetectionID> detectionIDList = null)
        {
			// Return empty list of Detections if input jsonTokens is empty.
            if (jsonTokens.Count == 0)
            {
				return new List<Detection>();
            }

            // Create new list of Detections to store combined set of Detections for input jsonTokens.
            List<Detection> detectionHitList = new List<Detection>();

			// If input detectionIDList is null or empty then instantiate it with all valid DetectionID values.
			if (detectionIDList == null)
			{
				detectionIDList = new List<DetectionID>((DetectionID[])Enum.GetValues(typeof(DetectionID)));
			}

			// Convert input JSON document into deeper-parsed formats for most efficient FindEvil*
			// method invocations below.
			JsonBranch jsonBranch = ToBranch(jsonTokens);

			// Append any potential Detections from FindEvilInTokenEnriched method for current JSON document.
			detectionHitList.AddRange(
				FindEvilInTokenEnriched(jsonTokens, detectionIDList)
			);

			// Leaving below as placeholder if Branch-level detections are needed in the future.

			// Append any potential Detections from FindEvilInBranch method for current JSON document.
			// detectionHitList.AddRange(
			// 	FindEvilInBranch(jsonBranch, detectionIDList)
			// );

			// Order final list of Detection hits by Start index property.
			detectionHitList = detectionHitList.OrderBy(detection => detection.Start).ToList();

			// Return current list of Detection hits for current JSON document.
			return detectionHitList;
        }

		// Overloaded method to handle multiple input formats.
		public static List<Detection> FindEvil(JsonBranch jsonBranch, List<DetectionID> detectionIDList = null)
		{
			// Extract entire JSON document as single string.
			string jsonDocument = jsonBranch.Content;

			// Return list of Detections for input JSON document.
			return JsonParser.FindEvil(
					JsonParser.ToTokenEnriched(
						JsonParser.Tokenize(jsonDocument)
					)
                ,detectionIDList);
		}

        // Overloaded method to handle multiple input formats.
        public static List<Detection> FindEvil(List<JsonToken> jsonTokens, List<DetectionID> detectionIDList = null)
        {
			// Return list of Detections for input JSON document.
            return JsonParser.FindEvil(
					JsonParser.ToTokenEnriched(jsonTokens)
                ,detectionIDList);
        }

        // Overloaded method to handle multiple input formats.
        public static List<Detection> FindEvil(string jsonDocument, List<DetectionID> detectionIDList = null)
        {
			// Return list of Detections for input JSON document.
            return JsonParser.FindEvil(
					JsonParser.ToTokenEnriched(
						JsonParser.Tokenize(jsonDocument)
					)
                ,detectionIDList);
        }

        /// <summary>
        /// This method returns list of Detection objects for each Detection "hit" occurring for
		/// every iteratively traversed token of input JSON document.
        /// </summary>
        public static List<Detection> FindEvilInTokenEnriched(List<JsonTokenEnriched> jsonTokens, List<DetectionID> detectionIDList = null)
        {
			// Return empty list of Detections if input jsonTokens is empty.
            if (jsonTokens.Count == 0)
            {
				return new List<Detection>();
            }

            // Create new list of Detections to store set of Detections for input jsonTokens.
            List<Detection> detectionHitList = new List<Detection>();

			// If input detectionIDList is null or empty then instantiate it with all valid DetectionID values.
			if (detectionIDList == null)
			{
				detectionIDList = new List<DetectionID>((DetectionID[])Enum.GetValues(typeof(DetectionID)));
			}

			// Extract separate list of string-format tokens with unicode encoding syntax from input jsonTokens for later detections.
			List<JsonTokenEnriched> stringsWithUnicodeTokens = jsonTokens.Where(token => token.Format == JsonTokenFormat.String && token.ContentParsedList.Where(charToken => charToken.Format == JsonStringParsedFormat.Hex).ToList().Count > 0).ToList();

			// Extract separate list of string-format tokens in Policy Action/NotAction decoded path from input jsonTokens for later detections.
			List<JsonTokenEnriched> actionTokens = jsonTokens.Where(token => token.Type == JsonTokenType.Value && token.Format == JsonTokenFormat.String && (token.Path.ContentDecoded == "Statement.Action" || token.Path.ContentDecoded == "Statement.NotAction")).ToList();

			// Iterate over and evaluate each defined DetectionID for input JSON document's list of tokens.
			foreach (DetectionID curDetectionID in detectionIDList)
			{
				switch (curDetectionID)
				{
					case DetectionID.JSON_WHITESPACE_CARRIAGERETURN:
						// Calculate list of carriage return ('\r') Whitespace tokens in current JSON document.
						List<JsonTokenEnriched> carriageReturnTokens = jsonTokens.Where(token => token.Type == JsonTokenType.Whitespace && token.Content.Contains("\r")).ToList();

						if (carriageReturnTokens.Count > 0)
						{
							// Generate new Detection hit and append to list of Detections for current JSON document.
							detectionHitList.Add(
								new Detection(
									ToBranch(jsonTokens),
									"Official_SkyScalpel_Ruleset",
									new DateTime(2024, 07, 04),
									curDetectionID,
									$"Excessive Count of Carriage Return ('\\r) Whitespace Tokens in Entire JSON document ('{carriageReturnTokens.Count}')",
									"{\"Version\":\"2012-10-17\",  \r \r  \"Statement\":{\"Effect\":\"Allow\",\"Action\":[  \r  \"iam:Cre\u0061teAcc\u0065ssKey\"],\"Resource\":\"*\"}}",
									50.0 * carriageReturnTokens.Count
								)
							);
						}

						break;
					case DetectionID.JSON_WHITESPACE_MULTIPLE_NEWLINES:
						// Calculate list of multi-newline ('\n') Whitespace tokens in current JSON document.
						List<JsonTokenEnriched> multiNewlineTokens = jsonTokens.Where(token => token.Type == JsonTokenType.Whitespace && token.Content.Split("\n").ToList().Count > 2).ToList();

						if (multiNewlineTokens.Count > 0)
						{
							// Generate new Detection hit and append to list of Detections for current JSON document.
							detectionHitList.Add(
								new Detection(
									ToBranch(jsonTokens),
									"Official_SkyScalpel_Ruleset",
									new DateTime(2024, 07, 04),
									curDetectionID,
									$"Excessive Count of Multi-Newline ('\\n') Whitespace Tokens in Entire JSON document ('{multiNewlineTokens.Count}')",
									"{\"Version\":\"2012-10-17\",  \n  \n  \"Statement\":{\"Effect\":\"Allow\",\"Action\":[  \n\n  \"iam:Cre\u0061teAcc\u0065ssKey\"],\"Resource\":\"*\"}}",
									25.0 * multiNewlineTokens.Count
								)
							);
						}

						break;
					case DetectionID.JSON_UNICODE_PRINTABLE_CHARS:
						// Enumerate each jsonToken in jsonTokens.
						foreach (JsonTokenEnriched jsonToken in jsonTokens.Where(token => token.Format == JsonTokenFormat.String))
						{
							// Calculate number of printable unicode characters in string-format tokens in current JSON document.
							int unicodePrintableTokenCount = jsonToken.ContentParsedList.Where(charToken => charToken.Format == JsonStringParsedFormat.Hex && charToken.IsPrintable == true).Count();

							if (unicodePrintableTokenCount > 0)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										jsonToken,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"Unicode-Encoded Printable Characters Present in String-Format Tokens ('{jsonToken.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:Cr\\u002ateA\\u002AssKey\",\"Resource\":\"*\"}}",
										10.0 * unicodePrintableTokenCount
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_UNICODE_PRINTABLE_CHARS_IN_POLICY_ACTION:
						// Enumerate each action in actionTokens.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Calculate number of printable unicode characters in string-format tokens in Policy Action/NotAction decoded path in current JSON document.
							int unicodePrintableTokenPolicyActionCount = action.ContentParsedList.Where(charToken => charToken.Format == JsonStringParsedFormat.Hex && charToken.IsPrintable == true).Count();

							if (
								(action.Path.ContentDecoded == "Statement.Action" || action.Path.ContentDecoded == "Statement.NotAction") &&
								unicodePrintableTokenPolicyActionCount > 0
							)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"Unicode-Encoded Printable Characters Present in String-Format Tokens in Policy Action/NotAction Decoded Path ('{action.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:Cr\\u002ateA\\u002AssKey\",\"Resource\":\"*\"}}",
										15.0 * unicodePrintableTokenPolicyActionCount
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_UNICODE_WILDCARD_IN_POLICY_ACTION:
						// Enumerate each action in actionTokens.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Calculate number of wildcard ('*') unicode characters in string-format tokens in Policy Action/NotAction decoded path in current JSON document.
							int unicodePrintableWildcardTokenPolicyActionCount = action.ContentParsedList.Where(charToken => charToken.Format == JsonStringParsedFormat.Hex && charToken.ContentDecoded == "*").Count();

							if (
								(action.Path.ContentDecoded == "Statement.Action" || action.Path.ContentDecoded == "Statement.NotAction") &&
								unicodePrintableWildcardTokenPolicyActionCount > 0
							)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"Unicode-Encoded Wildcard Characters ('*') Present in String-Format Tokens in Policy Action/NotAction Decoded Path ('{action.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:Cr\\u002ateA\\u002AssKey\",\"Resource\":\"*\"}}",
										50.0 * unicodePrintableWildcardTokenPolicyActionCount
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_UNICODE_WILDCARDSINGLECHAR_IN_POLICY_ACTION:
						// Enumerate each action in actionTokens.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Calculate number of single-character wildcard ('?') unicode characters in string-format tokens in Policy Action/NotAction decoded path in current JSON document.
							int unicodePrintableWildcardSingleCharTokenPolicyActionCount = action.ContentParsedList.Where(charToken => charToken.Format == JsonStringParsedFormat.Hex && charToken.ContentDecoded == "?").Count();

							if (
								(action.Path.ContentDecoded == "Statement.Action" || action.Path.ContentDecoded == "Statement.NotAction") &&
								unicodePrintableWildcardSingleCharTokenPolicyActionCount > 0
							)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"Unicode-Encoded Single-Character Wildcard Characters ('?') Present in String-Format Tokens in Policy Action/NotAction Decoded Path ('{action.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:\\u003F\\u003f\\u003F\\u003FteAccessKey\",\"Resource\":\"*\"}}",
										50.0 * unicodePrintableWildcardSingleCharTokenPolicyActionCount
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_UNICODE_COLON_IN_POLICY_ACTION:
						// Enumerate each action in actionTokens.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Calculate number of colon (':') unicode characters in string-format tokens in Policy Action/NotAction decoded path in current JSON document.
							int unicodePrintableColonTokenPolicyActionCount = action.ContentParsedList.Where(charToken => charToken.Format == JsonStringParsedFormat.Hex && charToken.ContentDecoded == ":").Count();

							if (
								(action.Path.ContentDecoded == "Statement.Action" || action.Path.ContentDecoded == "Statement.NotAction") &&
								unicodePrintableColonTokenPolicyActionCount > 0
							)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"Unicode-Encoded Colon Characters (':') Present in String-Format Tokens in Policy Action/NotAction Decoded Path ('{action.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam\\u003ACreateAccessKey\",\"Resource\":\"*\"}}",
										50.0 * unicodePrintableColonTokenPolicyActionCount
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_UNICODE_WILDCARD_IN_POLICY_ACTION_MATCHING_ONE_ACTION:
						// Enumerate each action in actionTokens and lookup against known list of AWS Actions.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Perform lookup of decoded AWS Action value to retrieve any and all matching defined AWS Action value(s).
							List<AwsAction> matchingActions = JsonParser.GetAwsAction(action.ContentDecoded);

							if (
								matchingActions.Count() == 1 &&
								action.ContentParsedList.Where(charToken => charToken.ContentDecoded == "*").Count() > 0
							)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"Unicode-Encoded Wildcard Characters ('*') Present in String-Format Tokens in Policy Action/NotAction Decoded Path Matching Single Action ('{action.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:CreateAcce*Key\",\"Resource\":\"*\"}}",
										250.0
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_UNICODE_WILDCARDSINGLECHAR_IN_POLICY_ACTION_MATCHING_ONE_ACTION:
						// Enumerate each action in actionTokens and lookup against known list of AWS Actions.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Perform lookup of decoded AWS Action value to retrieve any and all matching defined AWS Action value(s).
							List<AwsAction> matchingActions = JsonParser.GetAwsAction(action.ContentDecoded);

							if (
								matchingActions.Count() == 1 &&
								action.ContentParsedList.Where(charToken => charToken.ContentDecoded == "?").Count() > 0
							)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"Unicode-Encoded Single-Character Wildcard Characters ('?') Present in String-Format Tokens in Policy Action/NotAction Decoded Path Matching Single Action ('{action.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:CreateAcce??Key\",\"Resource\":\"*\"}}",
										250.0
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_POLICY_ACTION_MATCHING_ZERO_ACTION:
						// Enumerate each action in actionTokens and lookup against known list of AWS Actions.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Perform lookup of decoded AWS Action value to retrieve any and all matching defined AWS Action value(s).
							List<AwsAction> matchingActions = JsonParser.GetAwsAction(action.ContentDecoded);

							if (matchingActions.Count() == 0)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"String-Format Token in Policy Action/NotAction Decoded Path Matching Zero Actions ('{action.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:DoesNotExist\",\"Resource\":\"*\"}}",
										10.0
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_POLICY_ACTION_MATCHING_ONE_ACTION_CASE_MISMSATCH:
						// Enumerate each action in actionTokens and lookup against known list of AWS Actions.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Perform lookup of decoded AWS Action value to retrieve any and all matching defined AWS Action value(s).
							List<AwsAction> matchingActions = JsonParser.GetAwsAction(action.ContentDecoded);

							if (
								matchingActions.Count() == 1 &&
								JsonParser.TrimOne(action.ContentDecoded,'"') != matchingActions[0].Action &&
								action.ContentParsedList.Where(charToken => charToken.ContentDecoded == "*" || charToken.ContentDecoded == "?").Count() == 0
							)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"String-Format Token in Policy Action/NotAction Decoded Path Matching One Action But With Casing Mismatch ('{action.Content}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"IaM:cREateACceSSKey\",\"Resource\":\"*\"}}",
										7.5
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_POLICY_ACTION_MULTIPLE_WILDCARD:
						// Enumerate each action in actionTokens and calculate number of wildcard ('*') characters.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Calculate number of wildcard ('*') characters in current action.
							int actionWildcardCount = action.ContentParsedList.Where(charToken => charToken.ContentDecoded == "*").Count();
							
							if (actionWildcardCount > 1)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"String-Format Token in Policy Action/NotAction Decoded Path Contains Multiple Wildcard ('*') Characters ('{actionWildcardCount}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:Cre*teA*ssKey\",\"Resource\":\"*\"}}",
										7.5
									)
								);
							}
						}

						break;
					case DetectionID.AWSPOLICY_POLICY_ACTION_MULTIPLE_WILDCARDSINGLECHAR:
						// Enumerate each action in actionTokens and calculate number of single-character wildcard ('?') characters.
						foreach (JsonTokenEnriched action in actionTokens)
						{
							// Calculate number of single-character wildcard ('?') characters in current action.
							int actionWildcardSingleCharCount = action.ContentParsedList.Where(charToken => charToken.ContentDecoded == "?").Count();
							
							if (actionWildcardSingleCharCount > 1)
							{
								// Generate new Detection hit and append to list of Detections for current JSON document.
								detectionHitList.Add(
									new Detection(
										action,
										"Official_SkyScalpel_Ruleset",
										new DateTime(2024, 07, 04),
										curDetectionID,
										$"String-Format Token in Policy Action/NotAction Decoded Path Contains Multiple Single-Character Wildcard ('?') Characters ('{actionWildcardSingleCharCount}')",
										"{\"Version\":\"2012-10-17\",\"Statement\":{\"Effect\":\"Allow\",\"Action\":\"iam:????teA???ssKey\",\"Resource\":\"*\"}}",
										7.5
									)
								);
							}
						}

						break;
				}
			}

			// Order final list of Detection hits by Start index property.
			detectionHitList = detectionHitList.OrderBy(detection => detection.Start).ToList();

			// Return current list of Detection hits for current JSON document.
			return detectionHitList;
        }

		// Overloaded method to handle multiple input formats.
		public static List<Detection> FindEvilInTokenEnriched(JsonBranch jsonBranch, List<DetectionID> detectionIDList = null)
		{
			// Extract entire JSON document as single string.
			string jsonDocument = jsonBranch.Content;

			// Return list of Detections for input JSON document.
			return JsonParser.FindEvilInTokenEnriched(
					JsonParser.ToTokenEnriched(
						JsonParser.Tokenize(jsonDocument)
					)
                ,detectionIDList);
		}

        // Overloaded method to handle multiple input formats.
        public static List<Detection> FindEvilInTokenEnriched(List<JsonToken> jsonTokens, List<DetectionID> detectionIDList = null)
        {
			// Return list of Detections for input JSON document.
            return JsonParser.FindEvilInTokenEnriched(
					JsonParser.ToTokenEnriched(jsonTokens)
                ,detectionIDList);
        }

        // Overloaded method to handle multiple input formats.
        public static List<Detection> FindEvilInTokenEnriched(string jsonDocument, List<DetectionID> detectionIDList = null)
        {
			// Return list of Detections for input JSON document.
            return JsonParser.FindEvilInTokenEnriched(
					JsonParser.ToTokenEnriched(
						JsonParser.Tokenize(jsonDocument)
					)
                ,detectionIDList);
        }

        /// <summary>
        /// This method returns DetectionSummary object consolidating and summarizing all input Detection objects
		/// returned by FindEvil* methods for input JSON document.
        /// </summary>
        public static DetectionSummary ToEvilSummary(List<Detection> detections, string jsonDocument)
        {
			// Return empty DetectionSummary if input detections is empty.
            if (detections.Count == 0)
            {
				return new DetectionSummary(jsonDocument);
            }

			// Calculate total score from input detections.
			double totalScore = detections.Sum(detection => detection.Score);

			// Extract unique lists of DetectionID and Name property values from input detections.
			List<DetectionID> distinctDetectionIDs = detections.Select(detection => detection.ID).DistinctBy(id => id).ToList();
			List<string> distinctDetectionNames = detections.Select(detection => detection.Name).DistinctBy(name => name).ToList();

			// Create and return DetectionSummary object for input jsonDocument.
			return new DetectionSummary(
				totalScore,
				detections,
				distinctDetectionIDs,
				distinctDetectionNames,
				jsonDocument
			);
        }
    }

    /// <summary>
    /// This enum defines all potential JSON token types.
    /// </summary>
    public enum JsonTokenType
    {
        Undefined = 0,
        BeginObject = 1,
        EndObject = 2,
        BeginArray = 3,
        EndArray = 4,
		Name = 5,
		Value = 6,
        NameSeparator = 7,
        ValueSeparator = 8,
		Whitespace = 9,
    };

    /// <summary>
    /// This enum defines all potential JSON token subtypes.
    /// </summary>
    public enum JsonTokenSubType
    {
        Undefined = 0,
		ObjectMember = 1,
		ArrayElement = 2,
    };

    /// <summary>
    /// This enum defines all potential JSON token formats.
    /// </summary>
