		AWSPOLICY_UNICODE_PRINTABLE_CHARS_IN_POLICY_ACTION,
		AWSPOLICY_UNICODE_WILDCARD_IN_POLICY_ACTION,
		AWSPOLICY_UNICODE_WILDCARDSINGLECHAR_IN_POLICY_ACTION,
		AWSPOLICY_UNICODE_COLON_IN_POLICY_ACTION,
