		AWSPOLICY_UNICODE_WILDCARDSINGLECHAR_IN_POLICY_ACTION_MATCHING_ONE_ACTION,
		AWSPOLICY_POLICY_ACTION_MATCHING_ZERO_ACTION,
		AWSPOLICY_POLICY_ACTION_MATCHING_ONE_ACTION_CASE_MISMSATCH,
		AWSPOLICY_POLICY_ACTION_MULTIPLE_WILDCARD,
		AWSPOLICY_POLICY_ACTION_MULTIPLE_WILDCARDSINGLECHAR,
    };
